import { useState } from "react";
import pflText from "../Assets/text.png";
export default function Match() {
  const [homeClub, setHomeClub] = useState("");
  const [homeClubGoals, setHomeClubGoals] = useState(null);
  const [awayClub, setAwayClub] = useState("");
  const [awayClubGoals, setAwayClubGoals] = useState(null);

  const handleSubmit = (event) => {
    event.preventDefault();
    alert(`${homeClub}! Welcome to PFL 2023. GoodLuck!`);
  };

  const handleHomeOption = (event) => {
    setHomeClub(event.target.value);
  };

  const isDisabled = homeClubGoals === null || awayClubGoals === null || homeClub === ""

  return (
    <div>
      <img
        src={pflText}
        alt="Logo"
        style={{
          display: "block",
          margin: "auto",
          width: "300px",
          marginTop: "20px",
        }}
      />
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <h1
          style={{
            marginTop: "40px",
            backgroundColor: "#138ce8",
            width: "300px",
            textAlign: "center",
            height: "70px",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          Add Match
        </h1>
      </div>
      <div className="addMatchBox">
        <div className="matchBox">
          <form onSubmit={handleSubmit}>
            <div className="addMatch">
              <select
                style={{ marginLeft: "-15px" }}
                value={homeClub}
                onChange={handleHomeOption}
              >
                <option value="">Choose Home Club</option>
                <option value="option1">Akela</option>
                <option value="option2">Ceros</option>
                <option value="option3">Grizzly</option>
                <option value="option4">Hydra</option>
                <option value="option5">Raptors</option>
                <option value="option6">Stags</option>
                <option value="option7">Tusker</option>
                <option value="option8">Valiente</option>
              </select>
              <i></i>
            </div>
            <div className="addMatch">
              <input
                type="number"
                required="required"
                value={homeClubGoals}
                onChange={(e) => setHomeClubGoals(e.target.value)}
              />
              <span>Goals</span>
              <i></i>
            </div>
            <h1>VS</h1>
            <div className="addMatch" style={{ marginTop: "-10px" }}>
              <select style={{ marginLeft: "-15px" }}>
                <option value="">Choose Away Club</option>
                <option value="option1">Akela</option>
                <option value="option2">Ceros</option>
                <option value="option3">Grizzly</option>
                <option value="option4">Hydra</option>
                <option value="option5">Raptors</option>
                <option value="option6">Stags</option>
                <option value="option7">Tusker</option>
                <option value="option8">Valiente</option>
              </select>
              <i></i>
            </div>
            <div className="addMatch">
              <input
                type="number"
                required="required"
                value={awayClubGoals}
                onChange={(e) => setAwayClubGoals(e.target.value)}
              />
              <span>Goals</span>
              <i></i>
            </div>
            <input type="submit" value="Add Match" disabled={isDisabled} />
          </form>
        </div>
      </div>
    </div>
  );
}
